function Table(res){
    const [tableData, setTableData] = useState()
    const [row, setRow] = useState([0,1,2,3])
    const [page, setPage] = useState(1)


    useEffect(() => {
        console.log(res.data)

        setTableData(res.data);

    }, [page])
    function handleClick(){
        // setRow([4,5,6,7])
        setPage(page +1)
    }
    return(
        <div>

                {
                    tableData.length ? tableData.map(res => <div key={tableData.id}>{tableData.title}</div>) : console.log("error")
                }

        <p>{page}</p>
        <button onClick={handleClick}>see recipes</button>
        </div>
    )
}


export default Table;
